:250;a:1:{s:7:"caption";s:2212:"Leontine & Heron! I used to see people wearing sweaters with shorts and thought, ‚Äúbut why?‚Äù I truly thought this was an odd combination until today when I wanted to wear my new @sezane knit but didn‚Äôt want to be too hot. I get it now! 

This is the Leontine sweater from @sezane. I love Sezane‚Äôs knits so Fall is my favourite time to buy. I bought the Leontine and Betty during the Pre-Fall launch. These are not new styles. I‚Äôve liked the Betty since it‚Äôs release last year and the Leontine was restocked because it was an in-demand item. This looks like a very basic sweater and I normally find buying basics boring but I think it has some great details plus I have two other striped tops from Sezane and love them. What I think keeps this sweater from being too basic is the button placket and the blouson sleeve. The tiny horn-style mini buttons are a charming detail. I‚Äôm wearing a size small which I was worried about because the sweater seems very oversized on the model but I‚Äôm super happy with how this fits me. The Leontine can easily make you look wide with the stripes and boxy style so I took a cue from @mademoisellejaime who reviewed these on her site and tried pairing it with a thinner-legged jean which gave me more shape and balanced the look. Today I craved wearing this knit so I paired it with the Heron short from @shopdoen and I love the results! 

Heron! The Heron has pleats and a wide leg opening which creates a lovely hourglass shape but the high-waist, and structured fabric to give it a more tailored look. This sweater needs structure and I tucked it in so you could see the hardware and to bring the eye in so my shape wasn‚Äôt lost. I added some chunky sandals to balance out the look. If you watch my videos I actually planned to return these shorts because they were a bit snug but I tried them during bloaty time of the month so I waited to send them back. They fit a lot better and I‚Äôm happy I kept them. I find shorts hard to style because they are so unstructured and casual so usually feel sloppy to me. A structured style works well with all of my pretty blouses. I would say this style fits a bit small. I‚Äôm wearing a size 6. 

